import React from 'react'
import { AppContext } from '../App';
import { useContext } from 'react';
import { useNavigate } from "react-router-dom";
import Graphics from './Graphics';


function Data() {
  const {result, pagination, setPagination} = useContext(AppContext)
  const navigate = useNavigate();
  function previous() {
    setPagination((i) => (i -= 1));
    navigate('/babyplanner')
  }
  function next() {
    setPagination((i) => (i += 1));
    navigate('/')
  }
  return (
    <div>
      {<Graphics />}
      {result && result.months.map(i => <h1>{i}</h1>)}
      <div className="buttons">  
          <button onClick={previous} className="btn1">
            Babyplanner
          </button>
          <button type="submit" className="btn">
            Save result
          </button>
          <button onClick={next} className="btn2">
            Home
          </button>
          </div>
        </div>
  )
}

export default Data
